import React from "react";
import { Layout } from "../components/Layout/Layout";
import Carousel from "../components/Carousel";

const HomePage = () => {
  return (
    <Layout>
      <div className="items-center">
        {/* Carousel */}
        <Carousel />

        <div className="p-6 grid grid-cols-1 gap-6 md:grid-cols-2  md:p-28">
          <button className="bg-gradient-to-r from-sky-500 to-indigo-500 rounded-[50px] w-full h-[300px]"></button>
          <button className="bg-black rounded-[50px] w-full h-[300px]"></button>
          <button className="bg-black rounded-[50px] w-full h-[300px]"></button>
        </div>
      </div>
    </Layout>
  );
};

export default HomePage;
